import React from "react";
import "./Frame48.css";

function Frame48(props) {
  const { spanText, spanText2 } = props;

  return (
    <div className="frame-413">
      <div className="frame-6512 border-1px-onyx">
        <div className="enterprise-title">
          <span className="span08">{spanText}</span>
          <span className="span18">{spanText2}</span>
        </div>
      </div>
    </div>
  );
}

export default Frame48;
